import './App.css';
import Nav from "./Nav";
import Category from "./Category";
import Product from "./Product";
import {Container, Row, Col} from 'reactstrap';
import React, {Component} from "react";

class App extends Component {
    infoNav = {title:"My Web Page"};
    infoCategory = {title: "Category List"};
    infoProduct = {title:"Product List"};

    render() {
        return (
            <div className="App">
                <Container>
                    <Row>
                        <Col>
                            <Nav info={this.infoNav}/>
                        </Col>
                    </Row>
                    <Row>
                        <Col xs = "3">
                            <Category info={this.infoCategory}/>
                        </Col>
                        <Col xs = "9">
                            <Product info={this.infoProduct}/>
                        </Col>
                    </Row>
                </Container>
            </div>
        );
    }
}

export default App;
